from datetime import datetime
import logging
from typing import List, Dict, Any

# Configure logging
logging.basicConfig(level=logging.INFO)

# Base classes for users
class User:
    def __init__(self, user_id: str):
        self.user_id = user_id

class Developer(User):
    def log_issue(self, message: str):
        logging.info(f"[Developer {self.user_id}] {message}")

class UIUser(User):
    def report_to_agencies(self, report: str):
        logging.info(f"[UI User {self.user_id}] Reporting to agencies: {report}")

class AgencyUser(User):
    def submit_data(self, data: Dict[str, Any]):
        logging.info(f"[Agency User {self.user_id}] Submitting data: {data}")

class BrokerUser(User):
    def upload_file(self, file_path: str):
        logging.info(f"[Broker User {self.user_id}] Uploading file: {file_path}")

class FABSUser(User):
    def submit_fabs(self, submission_id: str):
        logging.info(f"[FABS User {self.user_id}] Submitting FABS with ID: {submission_id}")

# Task processing classes
class Task:
    def __init__(self, user: User, description: str):
        self.user = user
        self.description = description
        self.timestamp = datetime.now()

    def process(self):
        logging.info(f"[{self.timestamp}] Processing task: {self.description} by {self.user.user_id}")
        # Implement task-specific logic based on user role
        if isinstance(self.user, UIUser):
            self.user.report_to_agencies("User testing contributions.")
        elif isinstance(self.user, Developer):
            self.user.log_issue("Logging issue for troubleshooting.")
        elif isinstance(self.user, BrokerUser):
            self.user.upload_file("path/to/file")
        elif isinstance(self.user, AgencyUser):
            self.user.submit_data({"key": "value"})
        elif isinstance(self.user, FABSUser):
            self.user.submit_fabs("submission_id")

